 ('287', '3', 'de_de', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Snapchat.craft.dev. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, 'left', NULL, NULL, NULL, NULL, '0', NULL, NULL, 'white', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, NULL, '2017-08-07 18:42:15', '2017-08-07 18:42:15', 'ea03c0da-91ad-414f-9a95-a97ee768d2da'),
